---RegisterCommand('+handsup', function()
---    handsUp = true
---end, false)
---RegisterCommand('-handsup', function()
---    handsUp = false
---end, false)
---
---RegisterKeyMapping('+handsup', 'Hands Up', 'keyboard', 'i')
---
----- Alternate keybinding syntax
---RegisterKeyMapping('~!+handsup', 'Hands Up - Alternate Key', 'keyboard', 'o')
---```
